// ==UserScript==
// @name         Autofill Status & Team for GTO & GTE toolkits
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  try to take over the world!
// @author       You
// @match        [insert pipeline URL]
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    let urlForEditForm = window.location.href;
    let urlForDispForm = document.getElementsByTagName("li")[21].children[0].href;

    let title;
    let priority;
    let eligableForOperations;
    let eligableForInfrastructure;
    let needsManualProcessing;
    let hasCategoryFieldRequired;
    let teamField;

    let isDKToolkit = urlForEditForm.includes("GTO");
    let isNCINFRAToolkit = urlForEditForm.includes("NCINFRA");
    let isERSTToolkit = urlForEditForm.includes("ERST");

    console.log('isDKToolkit: ' + isDKToolkit);

    if(isERSTToolkit){ //This toolkit unfortunately has different id's on the HTML elements and therefore this seperate method is required for that
        title = document.getElementById('ctl00_ctl42_g_ca491857_289f_4f64_9af2_a688a93d3a9c_ctl00_ctl05_ctl02_ctl00_ctl00_ctl05_ctl00_ctl00_TextField').value.toLowerCase();
        priority = document.getElementById('ctl00_ctl42_g_ca491857_289f_4f64_9af2_a688a93d3a9c_ctl00_ctl05_ctl03_ctl00_ctl00_ctl05_ctl00_DropDownChoice').value.toLowerCase();
        document.getElementById('ctl00_ctl42_g_ca491857_289f_4f64_9af2_a688a93d3a9c_ctl00_ctl05_ctl10_ctl00_ctl00_ctl05_ctl00_DropDownChoice').value='11 - Modtaget';
        teamField = document.getElementById('ctl00_ctl42_g_ca491857_289f_4f64_9af2_a688a93d3a9c_ctl00_ctl05_ctl17_ctl00_ctl00_ctl05_ctl00_Lookup');
    }
    else{
        title = document.getElementById('Title_fa564e0f-0c70-4ab9-b863-0177e6ddd247_$TextField').value.toLowerCase();
        priority = document.getElementById('Priority_a8eb573e-9e11-481a-a8c9-1104a54b2fbd_$DropDownChoice').value.toLowerCase().charAt(0);
        hasCategoryFieldRequired = document.getElementById('Category_ba32921c-65ed-4435-97ec-b69aeae0449a_$DropDownChoice') != undefined;
    }

    eligableForOperations = title.includes('alert orion') && (priority.includes('c') || priority.includes('d')) && !title.includes('batchjob') && !isNCINFRAToolkit;
    eligableForInfrastructure = isNCINFRAToolkit && (priority.includes('c') || priority.includes('d'));
    needsManualProcessing = title.includes('batchjob') || (priority.includes('a') || priority.includes('b') || isNCINFRAToolkit); // maybe isNCINFRAToolkit should
                                                                                                //be used as a paramter on fillOutTeamInField instead of being here

    console.log('eligableForOperations: ' + eligableForOperations);
    console.log('eligableForInfrastructure: ' + eligableForInfrastructure);
    console.log('needsManualProcessing: ' + needsManualProcessing);

    if (!isERSTToolkit){
        if (isDKToolkit){
            teamField = document.getElementById('Team_d094a2ae-b50b-4b46-83af-3fb15c77805a_$LookupField');
            document.getElementById('Status_c15b34c3-ce7d-490a-b133-3f4de8801b76_$DropDownChoice').value='11 - Modtaget';

        }
        else{
            teamField = document.getElementById('Team_12eb012e-4ffc-41ea-9f78-2e611181685e_$LookupField');
            document.getElementById('Status_c15b34c3-ce7d-490a-b133-3f4de8801b76_$DropDownChoice').value='11 - Received';
        }
    }

    console.log("Prority: " + priority);
    console.log("hasCategoryFieldRequired: " + hasCategoryFieldRequired);

    if (hasCategoryFieldRequired){
        document.getElementById('Category_ba32921c-65ed-4435-97ec-b69aeae0449a_$DropDownChoice').value = "Alerts (create new alert, handle alerts)";
    }

    if(eligableForOperations){
        fillOutTeamInField("Operations");
        saveAndRedirectBack(7000);
    }
    else if(eligableForInfrastructure){ //Needs to be thouroughly testet
        fillOutTeamInField("Infrastruktur");
        saveAndRedirectBack(7000);
    }
    else if(needsManualProcessing){
        soundAlert.play();
        saveAndRedirectBack(15000);
    }

    document.onkeyup = function(e) {
        if (e.ctrlKey && e.altKey && e.which == 83) {
            document.getElementById("Ribbon.ListForm.Edit.Commit.Publish-Large").click();
            console.log("ctrl + alt + S was pressed");
        }
    };

    function fillOutTeamInField(team){
        for (var i = 0; i < teamField.length; i++){
            if (teamField.options[i].text === team){
                console.log("Found team in list: " + teamField.options[i].text);
                let value = teamField.options[i].value;
                teamField.value = value;
                break;
            }
        }
    }

    function saveAndRedirectBack(millisecondsToWait){
        setTimeout(function(){ //Instead this could be used: await new Promise(r => setTimeout(r, 2000));
            document.getElementById("Ribbon.ListForm.Edit.Commit.Publish-Large").click();
            setTimeout(function(){
                let saveDialog = document.getElementById('ctl00_PlaceHolderMain_modalSave');
                console.log("Save Dialog is there: " + ((saveDialog != undefined) ||(saveDialog != null)));
                if (saveDialog != undefined || saveDialog != null){
                    saveDialog.click();
                }
            }, 2000)
            console.log("Finished waiting " + millisecondsToWait + " milliseconds");
            soundSuccess.play();
        }, millisecondsToWait)

        setTimeout(function(){ //Redirects back to DispForm to show the auto-changes made
            window.location.replace(urlForDispForm);
            console.log("Finished waiting " + (millisecondsToWait + 3000) + " milliseconds");
        }, (millisecondsToWait + 3000))
    }
    let soundSuccess = new Audio("data:audio/mpeg;base64,");
    let soundAlert = new Audio("data:audio/mpeg;base64,");
}
)();